column1:
10月22日    可以是传统, 也可以是古板;
可以是淑女, 也可以是做作;
可以是淡定自若, 也可以是墨守成规;
我依旧是我, 改变的, 只是你的眼光。    -无-

1910年9月7日    日出,你的名字激昂着你的人生;
月圆,你的人生卓越着你的艺术;
星熠,你的艺术绚烂着你的才情;
这里,你的才情丰蕴着你的技能.
